                    <h1><strong>Fusion</strong>Banking<p></p>
<p>Trade <span class="title-box inline-dots">Innovation</span></p></h1>
                    <div id="inline-logos">


                    </div>
                    <h2>Automating trade finance to transform service and become the go-to bank</h2>
                    <p>New economics, trade dynamics and evolving corporate supply chains have redefined trade finance. Revenue growth is dependent on margin improvement and being able to compete on service levels. Profitable growth is a challenge.</p>
<p>Operational scalability, workflow flexibility, transparency and support for a broad range of products are critical for banks looking to grow revenues from international trade and working capital finance.</p>
<p>FusionBanking Trade Innovation supports both traditional trade and supply chain finance on a single platform for business transformation. More than 200 banks reduce costs, increase productivity, broaden their product range, and improve client retention using the platform. With process automation and transparency you can implement world-class, tailored SLAs for any client to gain a competitive advantage. Trade banks with multi-regional processing requirements are empowered to relocate operations to lower cost centres and benefit from economies of scale.</p>
<p>The solution is fully integrated with the trade and supply chain finance modules of Misys FusionBanking Corporate Channels to achieve complete STP from front-end online and mobile channels, to back-office operations.&nbsp;</p>
<p>&nbsp;<a href="http://www.swift.com/partners/locator/index.page?panel=1" target="_blank"><img width="270" height="54" src="css/swift_certified_application_tradefinance_2015_web_270x54.jpg" alt="SWIFT Cert App Tradefinance Web"></a></p>
<p><span>Misys has been accredited with the above SWIFT label. For further information visit&nbsp;</span><a href="http://www.swift.com/partners/locator/index.page?panel=1" target="_blank">SWIFT</a></p>
<p><span>Subcribe to &nbsp;<a href="http://www.test.com/feed"><img src="css/feed_small.png" alt="subscribe via rss"/></a>&nbsp;for FusionBanking Trade Innovation updates.</span></p>                
                </div>
                <div class="xlarge-9 large-9 medium-18 small-18 columns">
                    <p class="page-summary">Turn efficiency into growth. A trade finance platform to drive margin improvement, win on client service and innovate in supply chain finance.</p>
